#!/usr/bin/perl
use strict;
use warnings FATAL => 'all';
use Data::Dump qw(dump);

sub countingDNANucleotides {
    my $countA = () = $_[0]->{"dnaString"} =~ m/A/g;
    my $countC = () = $_[0]->{"dnaString"} =~ m/C/g;
    my $countG = () = $_[0]->{"dnaString"} =~ m/G/g;
    my $countT = () = $_[0]->{"dnaString"} =~ m/T/g;
    return ({"A"=>$countA ,"C"=>$countC ,"G"=>$countG,"T"=>$countT});
}

sub transcribingDNAintoRNA {
    my $rna = $_[0]->{"dnaString"};
    $rna =~ s/T/U/g;
    return ({"rnaString"=>$rna});
}

sub complementingDNA {
    my $dna = $_[0]->{"dnaString"};
    $dna =~ y/AT/TA/;
    $dna =~ y/CG/GC/;
    $dna = reverse($dna);
    return ({"reverseDna"=>$dna});
}

sub wascallyWabbits {
    my $n = shift;
    my $k = shift;

    if ($n <= 2) {
        return 1;
    }

    return (wascallyWabbits($n-1, $k) + $k*wascallyWabbits($n-2, $k));
}

sub cGContent {
    my $dna = shift;
    my $cg = () = $dna =~ /(C|G)/gi;
    return 100*$cg/length($dna);
}

sub computingCGContent {
    my $fasta = $_[0]->{"fastaString"};
    $fasta =~ s/\n//g;
    $fasta =~ s/[^a-zA-Z0-9]//g;
    my @fastaArray =
    my %fastaHash = ();
    foreach (split( /Rosalind/, $fasta)) {
        my $fastaKey = substr($_,0,4);
        if($_) {
            $fastaHash{$fastaKey} = cGContent(substr($_,4));
        }
    }

    my @sorted = sort { $fastaHash{$b} <=> $fastaHash{$a} } keys %fastaHash;

    for (@sorted) {
        print "$_\t=> $fastaHash{$_}\n";
    }

    return @sorted;
}

